// SPDX-License-Identifier: MIT
pragma solidity ^0.7.0;

/**
 * Migration contract to recover SHA256-based deposits
 * This allows withdrawal from the old contract
 */
contract TornadoMigration {
    address constant OLD_TORNADO = 0x50af9dD094cd43A14FFFC38FbDb17C99eAc79A71;

    // SHA256 commitments from old contract
    mapping(bytes32 => address) public deposits;
    mapping(bytes32 => bool) public withdrawn;

    // Owner for emergency recovery
    address public owner;

    modifier onlyOwner() {
        require(msg.sender == owner, "Not owner");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    // Register your SHA256 commitment for recovery
    function registerDeposit(bytes32 commitment) external {
        deposits[commitment] = msg.sender;
    }

    // Withdraw with SHA256 verification (simplified for recovery)
    function withdrawSHA256(
        bytes memory note,
        bytes32 commitment,
        bytes32 nullifierHash,
        address payable recipient
    ) external {
        require(deposits[commitment] == msg.sender, "Not your deposit");
        require(!withdrawn[nullifierHash], "Already withdrawn");

        // Verify the note generates the commitment (SHA256)
        bytes32 computedCommitment = sha256(note);
        require(computedCommitment == commitment, "Invalid note");

        withdrawn[nullifierHash] = true;

        // Transfer 1M PLS
        recipient.transfer(1000000 ether);
    }

    // Emergency recovery by owner
    function emergencyRecover(
        bytes32 commitment,
        address payable recipient
    ) external onlyOwner {
        require(!withdrawn[commitment], "Already withdrawn");
        withdrawn[commitment] = true;
        recipient.transfer(1000000 ether);
    }

    // Receive PLS
    receive() external payable {}
}
